export default function getAll() {
  return artifacts;
}

export function setArtifacts(artifactsList) {
  return artifactsList;
}

export function searchArtifacts(query) {
  query = query.toLowerCase();
  const results = [];

  artifacts.forEach(item => {
    if (item.title.toLowerCase().includes(query)) {
      results.push(item);
    }
    else if (item.tags.some(it => it.toLowerCase().includes(query))) {
      results.push(item);
    }
  })

  return results;
}

export function addLike(itemId, user) {
  if (!user) {
    console.log("not signed in");
    return;
  }

  artifacts = artifacts.map(item => {
    if (!item) return item;
    if (item._id === itemId) {
      const alreadyLiked = item.like.some(likeUser => likeUser._id === user._id);
      if (!alreadyLiked) {
        return { ...item, like: [...item.like, user] };
      }
    }
  });
}

export function removeLike(itemId, userId) {
  artifacts = artifacts.map(item => {
    if (!item) return item;
    if (item._id === itemId) {
      return {
        ...item,
        like: item.like.filter(likeUser => likeUser._id !== userId),
      };
    }
  });
}
